import React from 'react';

const Index = () => {
    return (
          <div className="bg-gray-300 max-w-6xl mx-auto container mt-20 p-2">
              <div className="flex flex-wrap items-center">
                  <div className="w-screen text-center lg:w-2/3">
                      <h1>Josiah Rose</h1>
                  </div>
              </div>
          </div>
    )
}

export default Index;
